import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home.vue'
import About from './views/About.vue'
import Login from './views/Login.vue'
import Register from './views/Register.vue'
import CreateArticle from './views/CreateArticle.vue'
import NgeditArticle from './views/NgeditArticle.vue'


Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/about',
      name: 'about',
      component: About
    },
    {
      path: '/login',
      name: 'login',
      component: Login
    },
    {
      path: '/register',
      name: 'register',
      component: Register
    },
    {
      path: '/article',
      name: 'article',
      component: CreateArticle
    },
    {
      path: '/articleEdit',
      name: 'articleEdit',
      component: NgeditArticle
    }
  ]
})
